import React from 'react';
import ReactDOM from 'react-dom';

function Title(){
  return (
    <div className = 'book'>
      The Title
    </div>
  )
}

function Author() {
  return (
    <div className = 'author'>
      The Author
    </div>
  );
}

function Stats() {
  return (
    <div className = 'stats'>
      5 stars
    </div>
  );
}

function MyThing() {
  return [<Title/>, <Author/>, <Stats/>]
}

ReactDOM.render(
  <MyThing/>,
  document.querySelector('#root')
);
